import React, {useState} from 'react'
import Link from 'next/link'
import Header from '../components/Header'
import Form from './Form'
import styles from '../components/Example.module.css'



export default function Contact() {

    const [formState] = useState ({
        form_info: [
            {first: ' '},
            {last: ' '},
            {address: ' '},
            {state: ' '},
            {county: ' '},
            {zipcode: ' '}

        ],
    })

    return(
        <div>

        <style global jsx>{` 

                body {
                    padding: 0;
                    margin: 0;
                }         
                a {
                    text-decoration: none;
                }
        `}
        </style>


        <Header />
        {/* <p> This is contact page</p> */}
            <section className={styles.contact} >

                <a className={styles.contact_center} >click here for the form</a>

                <Form
                first={formState.form_info[0].first}
                last={formState.form_info[0].first}
                address={formState.form_info[0].first}
                city={formState.form_info[0].first}
                fir={formState.form_info[0].first}
                first={formState.form_info[0].first}

                >

                </Form>

            </section>


        </div>
    )
}
